from z3 import *
import regex

def tohex(val, nbits):
  return hex((val + (1 << nbits)) % (1 << nbits))


def GetInt(payload=None, ishex=True):
    if ishex == False:
        num = [int(s) for s in regex.findall(r"-\b\d+\b", payload)]
    else:
        num = [int(s, 16) for s in regex.findall(r"-0[xX][0-9a-fA-F]+", payload)]
    return num

